	        guides: false,
	        highlight: false,
	        background: false,
			cropBoxMovable: false,
			cropBoxResizable: false,
			minContainerWidth: 154,
			cropped: function(e) {
				
			},
		});

		$(document).on('click', '#gantiFoto', function(e){
			e.preventDefault();
			$('#profileInput').click();
		});

		$(document).on('click', '#gantiFotoAnak', function(e){
			e.preventDefault();
			$('#profileAnakInput').click();
		});

		$(document).on('change', 'select[name=address_line3]', function(e){
			e.preventDefault();
			var region_id = $(this).val();
			$.ajax({
				type:'POST',
				url: SITE_URL+'users/get_city',
				dataType:'json',
				data:$.extend(tokens, {region_id:region_id}),
				success:function(res){
					tmlft();
					var html = '<option value="">Pilih Kabupaten</option>';

					$.each(res, function(i, val){
						html += '<option value="'+i+'">'+val+'</option>';
					});

					$('select[name=address_line4]').html(html).selectpicker('refresh');
				},
		   });
		});

		$(document).on('click', '#addChild', function(e){
			e.preventDefault();
			var valid = true;

			var child_gender = $('input[name=child_gender]:checked').val();
			if(!child_gender){
				valid = false;
				$('.child_gender').parents('.form-group').removeClass('has-success');
				$('.child_gender').parents('.form-group').addClass('has-danger');
				$('.child_gender').html('Jenis Kelamin Anak Dibutuhkan');
				$('.child_gender').show();
			}else{
				$('.child_gender').parents('.form-group').removeClass('has-danger');
				$('.child_gender').parents('.form-group').addClass('has-success');
				$('.child_gender').hide();
			}

			var child_name = $('input[name=child_name]').val();
			if(!child_name){
				valid = false;
				$('.child_name').parents('.form-group').removeClass('has-success');
				$('.child_name').parents('.form-group').addClass('has-danger');
				$('.child_name').html('Nama Anak Dibutuhkan');
				$('.child_name').show();
			}else{
				$('.child_name').parents('.form-group').removeClass('has-danger');
				$('.child_name').parents('.form-group').addClass('has-success');
				$('.child_name').hide();
			}

			var child_dob = $('input[name=child_dob]').data('datepicker').getFormattedDate('yyyy-mm-dd');
			if(!child_dob){
				valid = false;
				$('.child_dob').parents('.form-group').removeClass('has-success');
				$('.child_dob').parents('.form-group').addClass('has-danger');
				$('.child_dob').html('Tanggal Lahir Anak Dibutuhkan');
				$('.child_dob').show();
			}else{
				$('.child_dob').parents('.form-group').removeClass('has-danger');
				$('.child_dob').parents('.form-group').addClass('has-success');
				$('.child_dob').hide();
			}

			if(valid){
				image = '';
				if(add_image_anak){
					image = $profile_anak.cropper('getCroppedCanvas', {width:250, height:250}).toDataURL('image/jpeg');
				}

				$.ajax({
					type:'POST',
					url: SITE_URL+'users/add_child',
					dataType:'json',
					data:$.extend(tokens, {child_name:child_name, child_gender:child_gender, child_dob:child_dob, image:image}),
					success:function(res){
						tmlft();
						if(res.status){
							if(hash=='add-child'){
								window.location.href = SITE_URL + 'smart-strength-finder';
							}else{
								var html = '<div class="col-md-6 anak-item anak-item'+res.data.id+'">';
						  			html += '<div class="clearfix">';
						  				html += '<div class="anak-jk m-r-1">';
							  				html += '<img src="'+$profile_anak.cropper('getCroppedCanvas', {width:250, height:250}).toDataURL('image/jpeg')+'" style="width: 50px; height: 50px;">';
							  			html += '</div>';
							  			html += '<div class="anak-jk">';
							  					html += '<div class="jk '+(res.data.gender==1? 'boy' : 'girl')+'"></div>';
							  			html += '</div>';
							  			html += '<div class="anak-info">';
							  				html += '<p class="anak-nama">'+res.data.name+'</p>';
							  				html += '<p class="anak-umur">';
							  					html += '<span>'+res.data.dob+'</span>';
							  					html += '<span>';
							  					if(res.data.umur.y){
							  						html += res.data.umur.y+' Tahun ';
							  					}

							  					if(res.data.umur.m){
							  						html += res.data.umur.m+' Bulan';
							  					}
							  					html += '</span>';
							  				html += '</p>';
							  				html += ' <p class="action">';
							  					html += ' <a href="" data-image="'+(res.data.photo_profile.length ? res.data.photo_profile : SITE_URL+'addons/default/themes/wyeth/img/default-img.jpg')+'" data-id="'+res.data.id+'" data-gender="'+res.data.gender+'" data-dob="'+res.data.dob+'" data-name="'+res.data.name+'" id="editChild">Edit</a>';
							  					html += ' <a href="" data-id="'+res.data.id+'" id="removeChild">Hapus</a>';
							  				html += ' </p>';
							  			html += '</div>';
						  			html += '</div>';
						  		html += '</div>';

						  		$profile_anak.cropper('replace', SITE_URL+'addons/default/themes/wyeth/img/default-img.jpg');
					  			add_image_anak=false;
								$('#childList').append(html);
								$('input[name=child_name]').val('');
								$('input[name=child_dob]').val('');
