			$('input[name=child_gender]').filter('[value='+gender+']').attr('checked', true);
			$('input[name=child_name]').val(name);
			$("input[name=child_dob]").datepicker("setDate", dob[2]+'-'+dob[1]+'-'+dob[0]);
			$('input[name=child_id]').val(id);
			if(image){ 
				$profile_anak.cropper('replace', image, true);
			}
			$('#addChild').html('Update Anak');
			$('#addChild').attr('id', 'updateChild');
		});

